import React from "react";
import { BrowserRouter as Router } from "react-router-dom";

import DashBoardHader from "./dashBoardHader";

function DashBoard() {
  return (
    <div className="App">
      <Router>
        <DashBoardHader />
      </Router>
    </div>
  );
}

export default DashBoard;
